import { Link } from 'react-router-dom';
import axios from 'axios';
import { Card, Button } from 'react-bootstrap';

const Arts = () => {
    const cardInfo = [
        {image: 'https://www.messer.com/wp-content/uploads/project-image_The-Andrew_J_Brady_ICON_Music_Center.jpg', title: 'The Andrew J Brady ICON Music Center', text: 'description text'},
        {image: '', title: '', text: ''},
        {image: '', title: '', text: ''},
        {image: '', title: '', text: ''},
    ];

    return (
        <div>
            <Card style={{ width: '18rem' }}>
                <Card.Img variant="top" src="holder.js/100px180" />
                <Card.Body>
                    <Card.Title>Card Title</Card.Title>
                    <Card.Text>
                        Some quick example text to build on the card title and make up the bulk of
                        the card's content.
                    </Card.Text>
                    <Button variant="primary">Go somewhere</Button>
                </Card.Body>
            </Card>
        </div>
    )
};


export default Arts
